import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import horas from "../components/imagens/horas.svg"
import Duvida from "../components/imagens/duvida.svg"
import Logo from "../components/imagens/quest_logo.png"
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import "../components/Tela.css";



export default function Body_config() {
  return (
    <div className="bg-light">
      <Container className="mb-4 px-4 fonte_login">
        <Row>
            <Col>
                <h1 className="titulo_login alinhamento">Configurações</h1>
            </Col>
        </Row>
      </Container>
    </div>
  );
}
